import { withStyles } from "@material-ui/core";
import React from "react";

interface IProps {
  postId: string;
}

const CommentsSection = ({ postId }) => {
  return <p>Comments Section</p>;
};

export default CommentsSection;

const Container = withStyles({
  root: {
    margin: "1.5rem 0rem",
  },
});
